function mimeType_init() {
	window.mimeTypeExtension = {}
	var mimeType = {
		set: function(exts, mime) {
			if(exts.indexOf(",") > -1) {
				var ext = exts.split(",")
				for(var i = 0, l = ext.length; i < l; i++)
				{
					ext[i] = ext[i].trim()
					window.mimeTypeExtension[ext[i]] = mime
				}
			}
			else
			{
				window.mimeTypeExtension[exts] = mime
			}
		}
	}
	mimeType_init_fn(mimeType)
}

